import React, { useState, useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import axios from 'axios';
import mplcursors from 'mplcursors';  // For interactive hovering functionality

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const colorMap = {
  green: '#b0f4b4',
  orange: '#f7e4a0',
  red: '#f4a09c'
};

const SP500Return = () => {
  const [selectedAsset, setSelectedAsset] = useState(null);
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!selectedAsset) return;

    const fetchData = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`${process.env.REACT_APP_API_URL || 'http://localhost:8000'}/api/v1/${selectedAsset.endpoint}/`, {
          params: { days: 3650 }
        });

        const logTransformedData = response.data.map((item) => ({
          date: item.date,
          log_close_price: Math.log(item.close_price),
          dtcai: item.dtcai,
          color: item.color
        }));

        const chartData = {
          labels: logTransformedData.map((item) => item.date),
          datasets: [
            {
              label: `${selectedAsset.label} Log Price`,
              data: logTransformedData.map((item) => item.log_close_price),
              borderColor: 'black',
              tension: 0.1,
              fill: false,
              pointRadius: 0
            },
            {
              label: 'DTCai',
              data: logTransformedData.map((item) => item.dtcai),
              borderColor: 'rgb(255, 99, 132)', // Color for DTCai line
              tension: 0.1,
              borderDash: [5, 5],
              fill: false,
              pointRadius: 0
            }
          ]
        };

        // Adding background fill for color mapping
        logTransformedData.forEach((item, index) => {
          const color = colorMap[item.color] || 'white';
          chartData.datasets.push({
            label: item.color,
            data: [item.log_close_price],
            backgroundColor: color,
            borderColor: 'transparent',
            fill: true,
            pointRadius: 0
          });
        });

        setData(chartData);
        setError(null);
      } catch (err) {
        setError('Failed to load data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [selectedAsset]);

  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: selectedAsset ? `${selectedAsset.label} - Last 5 Years` : '',
      },
    },
    scales: {
      y: {
        beginAtZero: false,
      },
      x: {
        reverse: true,
      },
    },
    hover: {
      mode: 'nearest',
      intersect: false
    }
  };

  const handleBack = () => {
    setSelectedAsset(null);
    setData(null);
  };

  return (
    <div className="container mx-auto px-4 py-8">
      {!selectedAsset ? (
        <>
          <div style={{ width: '100%', height: '300px', marginBottom: '2rem', borderRadius: '0.75rem', overflow: 'hidden' }}>
            <img src="/yonsei_univ_photo.png" alt="Yonsei University" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
          </div>
          <div style={{ display: 'flex', flexDirection: 'row', gap: '1.5rem', overflowX: 'auto', paddingBottom: '1rem' }}>
            {/* Render assets */}
          </div>
        </>
      ) : (
        <div className="bg-white rounded-xl shadow-lg p-6">
          <div className="flex justify-between items-center mb-6">
            <h2 className="text-2xl font-bold text-gray-800">{selectedAsset.label}</h2>
            <button onClick={handleBack} className="btn-gradient red block px-6 py-2 text-white font-medium rounded-lg transition-all duration-300 hover:shadow-lg" style={{ background: 'linear-gradient(45deg, #1976d2, #42a5f5)', border: 'none', cursor: 'pointer' }}>
              ‚Üê Back to Assets
            </button>
          </div>
          {loading ? (
            <div className="flex justify-center items-center h-64">
              <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500"></div>
            </div>
          ) : error ? (
            <div className="text-red-500 text-center">{error}</div>
          ) : !data ? (
            <div className="text-center">No data available</div>
          ) : (
            <Line options={options} data={data} />
          )}
        </div>
      )}
    </div>
  );
};

export default SP500Return;
